<script>
import { Swipe, SwipeItem,Icon,List } from 'vant';
import Footers from '@/component/footer'
export default {
  components: {
    [Swipe.name]:Swipe,
    [SwipeItem.name]:SwipeItem,
    [Icon.name]:Icon,
    [List.name]:List,
  	Footers
  },
  data() {
    return {
      bannerList: [],           //banner数据
      navList: [],              //分类导航数据
      newsGoods: null,          //最新上市商品数据
      hotList: [],              //热销商品数据
      recommendList: [],        //为你推荐商品
      page: 1,
      pageNum: 10,
      pageTotal: '',
      loading: false,
      finished: false,
      keywords: '',
      isThrottle: false
    }
  },

  created() {
    this.getSwiperData()
    this.getNavData()
    this.getHotData()
    this.getRecommendData()
  },
  methods: {
    //获取首页轮播图数据
    getSwiperData() {
      const that = this
      this.$fetch('http://quhuiguoshi.zzqcnz.com/mobile/jiekou.php?act=ad_list', {}, false).then(res => {
        if (res.code === 0) that.bannerList = res.data
      })
    },
    //获取Nav分类导航数据
    getNavData() {
      const that = this
      this.$fetch('http://quhuiguoshi.zzqcnz.com/mobile/jiekou.php?act=index_category', {}, false).then(res => {
        if (res.code === 0) that.navList = res.data
      })
    },
    //获取热销商品数据
    getHotData() {
      const that = this
      this.$fetch('http://quhuiguoshi.zzqcnz.com/mobile/jiekou.php?act=new_goods', {}, false).then(res => {
        if (res.code === 0) that.hotList = [...res.data, ...res.data]
      })
    },
    //获取推荐数据
    getRecommendData() {
      const that = this
      if (this.isThrottle) {
        return
      }
      this.isThrottle = true
      let page = this.page
      let recommendList = this.recommendList
      let params = {
        page: page,
        num: this.pageNum
      }
      // this.loading = true
      this.$fetch('http://quhuiguoshi.zzqcnz.com/mobile/jiekou.php?act=guess_goods', params, false).then(res => {
        if (res.code === 0) {
            // let pageTotal = Math.ceil(parseInt(res.count) / 10)
            that.recommendList = [...recommendList, ...res.data]
            if (res.data.length === 10) {
              that.page++
            } else {
              that.finished =  true
            }
            // that.pageTotal = pageTotal
            // that.finished =  page >= pageTotal
            // if (pageTotal > page) {
            //   that.page++
            // }
            that.isThrottle = false
        }
      })
    },
    searchEnterFun(e) {
      var keyCode = window.event ? e.keyCode : e.which;
      //  console.log('回车搜索',keyCode,e);
      if (keyCode == 13 && this.keywords) {
        this.$router.push({ path: "/list?keywords=" + this.keywords });
      }
    },
    onLoad() {
      this.loading = false;
      this.getRecommendData();
    }
  }
};
</script>

